import React from "react";
import {Row, Col} from "react-bootstrap";
const MealSearch = ({meal}) => {

    console.log(meal);

    return (
        <Row className="mt-3">
            <h1 className="CategoriesTitle text-center">Meals</h1>
                
                            <Col key={meal.idMeal} xs={6} sm={6} md={4} lg={3} className="my-1">
                                    <div className="card">
                                        <img src={smeal.strMealThumb} className="card__image" alt="hu"/>
                                        <div className="CardCategor">
                                            <div className="w-100 p-2">
                                                <p className="CategoryName">{smeal.strMeal}</p>
                                            </div>
                                        </div>
                                    </div>
                            </Col>
        </Row>
    )
}

export default MealSearch;
